import React from 'react'

const Footer = () => {
    return (
        <div className="bg-gray-700 p-4">
            <div className="container mx-auto text-center">
                Projeto desenvolvido por: Tulio Faria / Linkedin / Github
            </div>
        </div>
    )
}

export default Footer
